import React from "react";
import styles from "./Footer.module.css";
import { TiLocation, TiMail, TiPhone } from "react-icons/ti";
const Footer = () => {
  return (
    <div className={styles.footer_container}>
      <div className={styles.foter_blocks_1}>
        <div>HOME</div>
        <div>ABOUT US</div>
        <div>DOMAINS</div>
        <div>TESTIMONIALS</div>
      </div>
      <div className={styles.foter_blocks_2}>
        <div>GALLERY</div>
        <div>ACHEIVMENTS</div>
        <div>BLOGS</div>
        <div>MEET OUR TEAM</div>
      </div>
      <div className={styles.foter_blocks_3}>
        <div><TiLocation /> KIET GROUP OF INSTITIUTIONS</div>
        <div>MURADNAGAR,GHAZIABAD</div>
        <div> <TiPhone/>+91-7302855302</div>
        <div><TiMail/>technocrats@kiet.edu</div>
        <div></div>
      </div>
    </div>
  );
};

export default Footer;
